要点1.《中华人民共和国社会保险法》第三十八条规定，因工伤发生的下列费用，按照国家规定从工伤保险基金中支付：
（一）治疗工伤的医疗费用和康复费用;
（二）住院伙食补助费;
（三）到统筹地区以外就医的交通食宿费;
（四）安装配置伤残辅助器具所需费用;
（五）生活不能自理的，经劳动能力鉴定委员会确认的生活护理费;
（六）一次性伤残补助金和一至四级伤残职工按月领取的伤残津贴;
（七）终止或者解除劳动合同时，应当享受的一次性医疗补助金;
（八）因工死亡的，其遗属领取的丧葬补助金、供养亲属抚恤金和因工死亡补助金;
（九）劳动能力鉴定费。 要点2.第三十五条 职工因工致残被鉴定为一级至四级伤残的，保留劳动关系，退出工作岗位，享受以下待遇：
（一）从工伤保险基金按伤残等级支付一次性伤残补助金，标准为：一级伤残为27个月的本人工资，二级伤残为25个月的本人工资，三级伤残为23个月的本人工资，四级伤残为21个月的本人工资；
（二）从工伤保险基金按月支付伤残津贴，标准为：一级伤残为本人工资的90%，二级伤残为本人工资的85%，三级伤残为本人工资的80%，四级伤残为本人工资的75%。伤残津贴实际金额低于当地最低工资标准的，由工伤保险基金补足差额； 因为被告没有参加工伤保险，因此医疗费、伤残补助金以及伤残津贴均由原告支出，门诊费用为两千，二级伤残的一次性伤残补助金为25个月的本人工资，以及退出工作岗位期间的伤残津贴。
